import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click Following tab in sidebar
    await page.waitForSelector('.sidebar-item[data-page="following"]');
    await page.click('.sidebar-item[data-page="following"]');

    // Wait for following page to load
    await page.waitForSelector('#followingPage', { state: 'visible' });
    await page.waitForTimeout(1000);

    // Take screenshot after navigating to Following page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_following_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_following_page.png'));

    // Click Users tab
    await page.waitForSelector('.following-tab-btn[data-tab="users"]');
    await page.click('.following-tab-btn[data-tab="users"]');

    // Wait for users tab content to load
    await page.waitForTimeout(1000);

    // Take final screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_users_tab.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_users_tab.png'));

    // Verify successful tab switch by checking active state
    const isUsersTabActive = await page.$eval('.following-tab-btn[data-tab="users"]', 
      el => el.classList.contains('active'));

    return {
      success: true,
      action: "Successfully navigated to Following page and switched to Users tab",
      extractedData: {
        usersTabActive: isUsersTabActive,
        currentTab: 'users'
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

